import React, {Component} from "react"
import * as d3 from "d3"
import _ from "lodash"

require('./Boroughs.scss')

const formatPercent = d3.format(".1f")
const formatNumber = d3.format(",")
// const formatIntelligence = d => _.times(_.round((d || 0) * 10), d => "|").join("")
const formatIntelligence = d3.format(".2f")
class Boroughs extends Component {
	state = {
		colorScale: _.noop,
	}

	componentDidMount() {
		this.updateColorScale()
	}
	componentDidCatch(error, info) {
	  this.setState({ error });
	  console.log(error)
	}
	componentDidUpdate(prevProps, prevState) {
		if (this.props.data != prevProps.data) this.updateColorScale()
	}

	updateColorScale = () => {
		const { data, percents, aspect } = this.props
		const colorScale = data ?
			d3.scaleLinear()
				.domain([0, d3.max(_.map(data, "percent"))])
				.range([aspect == "borough" ? "#e0e9ee" : "#fff", "#a2beb2"]) :
			_.noop
		this.setState({ colorScale })
	}

	onMouseOver = borough => () => {
		if (borough && this.onMouseOutDebounced) this.onMouseOutDebounced.cancel()
		this.props.onHover(borough)
	}
	onMouseOut = this.onMouseOver(null)
	onMouseOutDebounced = _.debounce(this.onMouseOut, 300)

	render() {
		const { title, data, isShowingAllDogs, onHover, className } = this.props
		const { colorScale, error } = this.state
		if (error) return null

		return (
			<div className={`Borough ${className}`}>
				<div className="Borough__title">
					{ title }
				</div>
				<div className="Borough__text-labels">
					{defaultBoroughs.map(borough => (
						<div key={borough} className={`Borough__text-label Borough__text-label--borough-${borough}`}>
							<div className="Borough__text-label__title">
								{ borough == "Bronx" ? "The Bronx" : borough }
							</div>
							{!!data && !!data[borough] && !!(data[borough] || {}).count && (
								isShowingAllDogs ? (
									<React.Fragment>
										<div className="Borough__text-label__value">
											{ formatNumber((data[borough] || {}).count) }
										</div>
										<div className="Borough__text-label__total">
											{ `${formatIntelligence((data[borough] || {}).intelligence || 0)} avg intelligence` }
										</div>
									</React.Fragment>
								) : (
								<React.Fragment>
									<div className="Borough__text-label__value">
										<span>
											{ formatPercent((data[borough] || {}).percent) }
											<div className="Borough__text-label__value__sign">
												%
											</div>
										</span>
									</div>
									<div className="Borough__text-label__total">
										{ `${formatNumber((data[borough] || {}).count || 0)} dogs` }
									</div>
									<div className="Borough__text-label__total">
										{ `${formatIntelligence((data[borough] || {}).intelligence || 0)} avg intelligence` }
									</div>
								</React.Fragment>
								)
							)}
						</div>
					))}
				</div>
				<svg width="540" height="540" viewBox="40 0 540 540" className="Borough__svg">
					{defaultBoroughs.map(borough => (
						<path key={borough}
							className="Borough__item"
							title={borough}
							d={paths[borough]}
							fill={data && !isShowingAllDogs ? colorScale((data[borough] || {}).percent || 0) : "#e0e9ee"}
							onClick={this.onMouseOver(borough)}
						/>
					))}
				</svg>
			</div>
		)
	}
}
